text:
@philipta Ja, Jeg ved en del mere end gennemsnitsdanskerne, som fyrer klassiske statistik floskler afsted. :-) 

Og revaccination kan være fint til folk i risikogrupper, men til børn, så giver det ganske enkelt ikke mening. 

Og det skal de vide, hvad de så gør, er op til dem selv

@Nancke87 Hvor har du set at vi støtter et lovbrud? Vi støtter kampen om at der ikke skal være barnebrude i Danmark. Ikke et lovbrud. 

Hvis du havde gidet at lytte til hvad Pernille sagde i går, så var der jo netop en kritik af at man ikke fik bragt loven i orden. 

Så stop med at lyv!
